import React, { useState } from 'react';

function Board() {
  return (
    <div>board</div>
  );

}
function Square() {
  return (
    <button class="square"></button>
  );

}
function Tiktak() {
  return (
    <div>
      <h2>Tiktak</h2>
      <div class="game-board">
        <Board />
      </div>
    </div>
  )
}


export default Tiktak;
